import React from "react";
import s from "./gallery.module.css";
import img1 from "../../assets/gallery/1.jpg"
import img2 from "../../assets/gallery/1.jpg"


const Gallery = () => {
  const defaultIages = [
    {
      img: img1,
      text: "first",
    },
    {
      img: img2,
      text: "second",
    },
  ];

  return (
    <div className={s.galery_main}>
      {defaultIages.map((imgObj) => {
        const { img, text } = imgObj;
        return (
          <div className={s.imageWrapper}>
            <img src={img} />
            <span>{text}</span>
          </div>
        );
      })}
    </div>
  );
};
export default Gallery;
